import { useState } from "react";
import GetUsersItem from "./components/GetUsersItem";

function Test() {
    function getUsers() {
        const [error, setError] = useState(null);
        const [isLoaded, setIsLoaded] = useState(false);
        const [GettedUsers, setGettedUsers] = useState([]);

        useEffect(() => {
            fetch('https://jsonplaceholder.typicode.com/posts')
              .then(response => response.json())
              .then(
                (result) => {
                  setIsLoaded(true);
                  setGettedUsers(result);
                },
                // Примечание: важно обрабатывать ошибки именно здесь, а не в блоке catch(),
                // чтобы не перехватывать исключения из ошибок в самих компонентах.
                (error) => {
                  setIsLoaded(true);
                  setError(error);
                }
              )
          }, [])
        
    }

    
    // const [userItems, setUserItems] = useState([
    //     {id: 1, name: 'Nazir', email: 'nazik@nosex.ru', phone: '78076002213', password: 'genshinimba2010'},
    //     {id: 2, name: 'MEV', email: 'Mevbx@sigma.ru', phone: '7**********', password: '************'},
    // ])

    const [userItems, setUserItems] = useState([])



    return (
        <div className="App">
            {userItems.map(item => 
                <GetUsersItem item={item} key={item.id} />
            )}
            
        </div>
    )
}

export default Test
